FEMALE. Generally more heavy-bodied and dorso-ventrally flattened than males. Ocular canthus more prominent. Eyes usually reduced to absent (with the exception of
E. dybasi
). Female genitalia: Largely membranous, comprising internalized ventrite 7 (visible as a transverse triangular strap in some specimens) and 2 internal sclerites that often appear sac-like.
